  false,\n\t\"url\": null,\n\t\"notes\": \"A study of fishery management at Des Lacs
  National Wildlife Refuge was conducted from June 18 to 20, 1952.  This brief preliminary
  report will serve to highlight the findings and set forth immediately apparent recommendations.
  \ Important water areas on Des Lacs NWR consist of seven impoundments on the Des
  Lacs River.  The upper two bodies of water, known as Middle and Upper Des Lacs Lakes,
  are the only ones that offer any possibility of fishery management, and even these
  can be considered marginal.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
